import logo from './Nielsenlogo.jpg';
import React,{useState} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './App.css';
import InfiniteList from 'react-infinite-scroll-list';

export default function ScrollableList() {
 const items = [{'id': 'id1','message':'message1'},{'id': 'id2','message':'message2'},{'id': 'id3','message':'message3'}]
  return (
      <div style={{height:50,backgroundColor:"blue"}}>
        <InfiniteList
          root="container"
          isLoading={true}
          isEndReached={true}
          onReachThreshold={() => {
            console.log('Load more content');
          }}
          containerClassName="custom-container-class-name"
          sentinelClassName="custom-sentinel-class-name"
          containerTagName="div"
          sentinelTagName="div"
          threshold={2}
        >
          {items.map(item => <div key={item.id}>{item.message}</div>)}
        </InfiniteList>
      </div>
  );
}
